sanityChecks.promptOutput:
{
  "hasMaterialIssues": true,
  "overallAssessment": "The tables form a generally coherent inventory and sales model, but several critical relationship details are missing or contradictory, especially around user references, receipt tracking, shipping charge semantics, and discount handling.",
  "tableIssues": [
    {
      "tableName": "InventoryAdjustment",
      "issueType": "missing_context",
      "severity": "high",
      "description": "The column 'usr' implies a reference to a user/employee entity, but no User table is defined in the dependency level, leaving the foreign key undefined.",
      "affectedTables": ["InventoryCount", "CustomerNote"],
      "suggestedFix": "Add a User (or Employee) master table and document the foreign key relationship from 'usr' columns to that table."
    },
    {
      "tableName": "InventoryCount",
      "issueType": "missing_context",
      "severity": "high",
      "description": "The column 'usr' also references a user entity that is not present, and there is no description of how count results affect the InventoryStatus table.",
      "affectedTables": ["InventoryAdjustment", "InventoryStatus"],
      "suggestedFix": "Define a User table and clarify that count variances update the 'qty' field in InventoryStatus."
    },
    {
      "tableName": "Receipt",
      "issueType": "relationship_inconsistency",
      "severity": "high",
      "description": "Receipt records are linked only to a purchase order (po_id) and not to specific purchase order line items, making it impossible to track received quantities per product.",
      "affectedTables": ["PurchaseOrderLine"],
      "suggestedFix": "Add a foreign key to PurchaseOrderLine (e.g., po_line_seq or prd_id) to capture which line items were received, or include a junction table for PO line receipts."
    },
    {
      "tableName": "PurchaseOrder",
      "issueType": "terminology",
      "severity": "medium",
      "description": "The 'ship_amt' column is described as a flat shipping charge (0 or 150 for expedited), which conflicts with the SalesOrder 'ship_amt' definition (0, 15, or 25). The term 'shipping charge' is used for both inbound (PO) and outbound (order) shipments without clarification.",
      "affectedTables": ["SalesOrder"],
      "suggestedFix": "Rename columns to distinguish inbound shipping (e.g., inbound_ship_amt) vs outbound shipping (outbound_ship_amt) and document the differing business rules."
    },
    {
      "tableName": "SalesOrder",
      "issueType": "business_logic",
      "severity": "medium",
      "description": "Discounts are represented both at the order level ('disc_pct' limited to 0% or 10%) and at the line level ('disc' in OrderLineItem). The relationship between these two discount mechanisms is not explained, leading to potential double‑discounting or ambiguity.",
      "affectedTables": ["OrderLineItem"],
      "suggestedFix": "Clarify whether 'disc_pct' applies to the entire order after line‑level discounts, or if line‑level discounts are the only discounts. Adjust schema or documentation accordingly."
    },
    {
      "tableName": "InventoryStatus",
      "issueType": "missing_context",
      "severity": "low",
      "description": "The table stores 'lst_rcv' (date of last receipt) but there is no documented link to the Receipt table, nor is it clear how adjustments and counts update this status.",
      "affectedTables": ["Receipt", "InventoryAdjustment", "InventoryCount"],
      "suggestedFix": "Document that 'lst_rcv' is populated from the most recent Receipt record for the product/warehouse and that inventory adjustments also affect 'qty' in this table."
    }
  ],
  "crossTableObservations": [
    {
      "observation": "Multiple tables reference a user/employee via a 'usr' column, yet no User master table exists, creating a systemic gap in the model.",
      "tables": ["InventoryAdjustment", "InventoryCount", "CustomerNote"]
    },
    {
      "observation": "Shipping cost semantics differ between inbound (PurchaseOrder) and outbound (SalesOrder) processes, but the schema uses the same column name 'ship_amt', which can cause confusion in reporting and integration.",
      "tables": ["PurchaseOrder", "SalesOrder"]
    },
    {
      "observation": "Discount handling is duplicated at order and line levels without clear hierarchy, risking inconsistent discount calculations.",
      "tables": ["SalesOrder", "OrderLineItem"]
    },
    {
      "observation": "Receipt tracking lacks granularity to the purchase order line level, making it impossible to reconcile ordered vs received quantities per product.",
      "tables": ["Receipt", "PurchaseOrderLine"]
    }
  ]
}
